@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix atm: <http://lod.csd.auth.gr/atm/atm.ttl#> .

atm:ATM rdf:type rdfs:Class .
atm:Account rdf:type rdfs:Class .
atm:Bank rdf:type rdfs:Class .
atm:CashCard rdf:type rdfs:Class .
atm:Customer rdf:type rdfs:Class .

atm:ownsCard rdf:type rdf:Property ;
    rdfs:domain atm:Customer ;
    rdfs:range atm:CashCard .

atm:belongsToBank rdf:type rdf:Property ;
    rdfs:domain atm:ATM ;
    rdfs:range atm:Bank .

atm:hasAccount rdf:type rdf:Property ;
    rdfs:domain atm:Customer ;
    rdfs:range atm:Account .

atm:cardIssuedBy rdf:type rdf:Property ;
    rdfs:domain atm:CashCard ;
    rdfs:range atm:Bank .

atm:Transaction rdf:type rdfs:Class .
atm:transactionSucceeded rdf:type rdf:Property ;
    rdfs:domain atm:Transaction ;
    rdfs:range rdfs:Literal .

atm:send rdf:type rdf:Property ;
    rdfs:domain atm:Bank ;
    rdfs:range atm:ATM .

atm:Message rdf:type rdfs:Class .
atm:messageContent rdf:type rdf:Property ;
    rdfs:domain atm:Message ;
    rdfs:range rdfs:Literal .

atm:TransactionSuccessMessage rdf:type rdfs:Class ;
    rdfs:subClassOf atm:Message ;
    rdfs:subClassOf [ rdf:type owl:Restriction ;
                      owl:onProperty atm:messageContent ;
                      owl:hasValue "transaction succeeded" ] .

atm:Bank rdfs:subClassOf [ rdf:type owl:Restriction ;
                           owl:onProperty atm:send ;
                           owl:someValuesFrom atm:TransactionSuccessMessage ] .
